import './Header.css';
import {NavLink} from "react-router-dom";

export const Header = () => {
    return (
        <header>
                <nav>
                    <NavLink to="/">Leaflet</NavLink>
                    <NavLink to="/d3">D3</NavLink>
                    <NavLink to="/mapbox">Mapbox</NavLink>
                </nav>
        </header>
    );
};
